        </svg>

        <article class="bg-white float-end ms-auto"
            style="width: 60%; border-radius: 80px 0px 0px 80px; padding: 20px 30px; transition: all .3s ease-in-out;">
            <!-- Media -->
            <div class="media">
                <h3 class="fw-bold text-center"
                    style="line-height: 39px; font-size: 25px; font-family: Aref Ruqaa Ink, serif;">Create Account</h3>

                <div class="sign-up d-flex align-items-center justify-content-around flex-wrap mt-4">
                    <button
                        class="btn-one btn d-flex justify-content-around align-items-center border-1 fw-bold w-100 mb-3"
                        style="
                            font-size: 25px;
                            line-height: 39px;
                            color: #737373;
                            border: solid #737373;
                            border-radius: 15px;
                            max-width: 397px;">
                        <img src="./google.png" alt="google image" style="width: 40px; height: 40px; float: left; ">
                        Sign up with Google
                    </button>

                    <button
                        class="btn-one btn d-flex justify-content-around align-items-center border-1 fw-bold w-100  mb-3"
                        style="font-size: 25px;
                            line-height: 39px;
                            color: #737373;
                            border: solid #737373;
                            border-radius: 15px;
                            
                            max-width: 397px;">
                        <img src="./facebook.png" alt="facebook image" style="
                                width: 40px;
                                height: 40px;
                                float: left;
                                ">
                        Sign up with Facebook
                    </button>
                </div>
            </div>

            <div class="main-form mt-5">
                <h4 class="fw-bold text-center" style="
                    line-height: 37px;
                    font-size: 30px;
                    color: #737373;">----
                    <span class="mx-2" style="font-family: inherit;">OR</span> ----
                </h4>

                <!-- Form -->
                <form style="padding-left: 6.1rem;"> <!-- action="" -->
                    <input type="text" class="form-control" placeholder="Full Name" style="
                            max-width: 566px;
                            margin-bottom: 30px;
                            border: 0;
                            border-bottom: 1px solid #737373;">
                    <input type="text" class="form-control" placeholder="Phone Number" style="
                            max-width: 566px;
                            margin-bottom: 30px;
                            border: 0;
                            border-bottom: 1px solid #737373;">
                    <input type="password" class="form-control" placeholder="Password" style="
                            max-width: 566px;
                            margin-bottom: 30px;
                            border: 0;
                            border-bottom: 1px solid #737373;">
                    <input type="text" class="form-control" placeholder="Age" style="
                        max-width: 566px;
                        margin-bottom: 30px;
                        border: 0;
                        border-bottom: 1px solid #737373;">

                    <div class="gender">
                        <h5 class="fw-normal text-start mb-3" style="
                                line-height: 37px;
                                font-size: 30px;
                                color: #737373;">Gender</h5>

                        <div class="d-flex align-items-center justify-content-start flex-wrap gap-5">
                            <div class="form-check d-flex align-items-center gap-3">
                                <input class="form-check-input" type="radio" name="flexRadioDefault" id="male" style="
                                        border: 1px solid #0070CD;
                                        width: 25px;
                                        height: 25px;">

                                <label class="form-check-label fw-normal" for="male" style="
                                        line-height: 37px;
                                        font-size: 30px;
                                        color: #737373;">
                                    Male
                                </label>
                            </div>
                            <div class="form-check d-flex align-items-center gap-3">
                                <input class="form-check-input" type="radio" name="flexRadioDefault" id="female" style="
                                        border: 1px solid #0070CD;
                                        width: 25px;
                                        height: 25px;">

                                <label class="form-check-label form-check-label fw-normal" for="female" style="
                                        line-height: 37px;
                                        font-size: 30px;
                                        color: #737373;">
                                    Female
                                </label>
                            </div>
                        </div>
                    </div>
                </form>
            </div>

            <!-- Button -->
            <div class="d-flex flex-column justify-content-between align-items-center gap-4 mt-5 butn" style="
                padding-left: 6.1rem;">
                <button class="btn text-white fw-bold"
                    style="border-radius: 15px; line-height: 25px; font-size: 20px; background-color: var(--azure-blue); height: 87px; width: 282px;">Create
                    Account</button>

                <p class="fw-normal" style="color: #737373; line-height: 25px; font-size: 20px;">Already have an
                    account? <a class="fw-bold text-decoration-none" href="../index.html"
                        style="color: var(--azure-blue)">Log in</a></p>
            </div>
        </article>
    </main>

    <script>
        const labels = document.querySelectorAll('.form-check-input');
        labels.forEach((input) => {
            input.addEventListener('click', (e) => {
                e.target.toggleAttribute('checked');
                e.target.hasAttribute('checked') ? e.target.nextElementSibling.style.color = "#0070CD" : e.target.nextElementSibling.style.color = '#737373';
            });
        })
    </script>
</body>

</html>
